EUROPE RECAP 

Man, what an amazing trip! 
I’m super grateful to everyone involved in making this a successful, inspiring and fun filled tour! 

Thank you to all the dancers who came out and rocked with me. I appreciate your support and cherish the unforgettable energy exchange!

So much love to all the studios/hosts/conventions for having me. See you again soon…😉

